import React, {Component} from "react";
import './App.css';
class App extends React.Component{
    render(){
        const currentTime = new Date(),
        hours = currentTime.getHours(),
        minutes = currentTime.getMinutes(),
        seconds = currentTime.getSeconds(),
        ampm = hours > 12 ? 'pm' : 'am';

    }
}
export default App;
